import classes from "./MainHeader.module.css";
import { NavLink } from "react-router-dom";
let MainHeader = () => {
  return (
    <div className={classes.header}>
      <div className={classes.logo}>Great quotes</div>
      <ul clas>
        <li>
          <NavLink to="/allQuotes" activeClassNmae={classes.active}>
            All quotes
          </NavLink>
        </li>
        <li>
          <NavLink to="/newQuote" activeClassNmae={classes.active}>
            Add a quote
          </NavLink>
        </li>
      </ul>
    </div>
  );
};
export default MainHeader;
